description:
Bridgette asked Ryan to come over and help her with the roof of her shed. Bridgette is a little jealous that she doesn't have anyone to help around the house like Ryan as his girlfriend does. Ryan lets her know he is being neighborly and can help inside the house too, around the kitchen or even the bedroom. 


